INSERT INTO `mdt_reports` (`id`, `author`, `title`, `type`, `details`, `tags`, `officersinvolved`, `civsinvolved`, `gallery`, `time`, `jobtype`) VALUES
	(1, 'Peter Kelp', 'Pastor Lips', 'Ran over by car', 'Submitted to ICU?: [No]\n\nIncident Report:\nShowed up to scene, Cops already on scene to handle primary health care- Ambulance escort.\n\nList of Injuries:\nFull body\n\nÃƒÂ°Ã…Â¸Ã¢â‚¬â„¢Ã¢â‚¬Â° Surgical Report:\nNone\n\n\nAttending:\n- [ List Any Attending Here ]\n\n\nMedications Applied:\nIbpro.\n\n\nNotes:\nPatient Mildly confused, signs of concussion', '[]', '[]', '[]', '[]', '1670091622045', 'ambulance'),
	(2, 'Frank BULLIT', 'Formal Report ', 'Complaint.', 'John Wilson Saw Officer El suave strike muliple people and cause an altercation to cause Mrs. Alfredo to strike back and cause to be illegally detained, Mr Alfredo wants to press charges. He will be taking this matter up with the captain.', '[]', '[]', '[]', '[]', '1670287597032', 'police'),
	(3, 'Axel Pierce', 'Pauly Alfredo', 'Missing Vehicle', 'Pauly Alfredo came over to Davis PD to report his vehicle missing at 8:37 PM . It is a black and white digital camo Itali RSX.', '[]', '[]', '[]', '[]', '1671223091691', 'police'),
	(4, 'Rico ElSuave', '1 Strike Point - Kimbo Mcnelly', 'Not Being in the Right Pursuit Mode', '+1 Strike Points', '[]', '[]', '[]', '[]', '1671502478785', 'police'),
	(5, 'Sleepy Ernado', 'House Robbery', 'Robbery', 'Showed Up to The Scene an Seen A Car Parked Ready to gateway away. I waited by the door for the suspect to come out. once i seen him pointed the taser, An Detained Him.', '[]', '["171"]', '[]', '[]', '1671643629060', 'police'),
	(6, 'Tristan Aetos', 'mathew david assaulted by  charles whinston', 'Assault on ems', 'Ems mathew david was assaulted by charles whinston while he was on duty, charles watson and kane one were messing around with a bank truck which led to kane to be ran over multiple times, mathews david attended to the wounds frustrated towards the behaviour of the 2 individuals. in result of this charles whinston threatened to hit mathews david with a flashlight. charles watson then attacked mathew davis. Mathew davis is wanting to press charges.', '[]', '[]', '["mathew jacobs"]', '[]', '1671668598063', 'police'),
	(7, 'Jean Paul', 'House robbery supposed hostage', 'Report for evidence', 'We show up to a scene that was a house robbery and this guy comes out and says hes the hostage and the other guys ran, and we searched him and confiscated 3 colt 1911s and a knife', '[]', '["160 Paul","180 Lockin"]', '[]', '[]', '1673760882119', 'police'),
	(8, 'buck columbo', 'Murder of LSPD CHIEF & GAME WARDEN', 'Murder', 'Start of the Investigation for the Murder of LSPD CHIEF \n\nDetails about the Incident: murder :)\n\nDate:\nLoctation\n\nCasing 21G ', '[]', '["Private Investigator Reggie Paul","Private InvestigatorÃ‚Â ","495 King"]', '[]', '[]', '1674283148459', 'police'),
	(9, 'jay cruz', 'wanted for attempted murder of leo', 'attempted murder', 'African American Male with Dreads , wearing White Hoodie with purple bandana on his face , black jeans with purple bandana hanging from the right side of jeans.\n\nofficers on scene 390 Cruz , Pi 601.', '[]', '["390"]', '["pi","601"]', '[]', '1679813374056', 'police'),
	(10, 'Matthew Jacobs', 'Unlawful Discharge of a firearm', 'Evidence', '927 and 495 was at DPD \nshots fired Central Med Inocense blv\n\ncasing id: 21GSN\n evidence locker 1000', '[]', '[]', '[]', '[]', '1680882239939', 'police'),
	(11, 'Matthew Jacobs', 'Vladimir Kozlov wanted for questioning.', 'possible house robbery', '927 encountered Vlad\'s white Subaru on a House roberry. the ARMED suspect claimed to be the owner of the house but fled when i asked for his ID. Vlad\'s Subaru was reported as stolen on Twitter but while waiting at the LS tuner shop it drove up to me and dropped off a possible jaquavius dingleberry. a Daniel Jorden working for Vlad\'s LS tuners identified the driver of the subaru as Vlad Kozlov. \n\nPossible charges:\n\nReckless Evading x2\nReckless endangerment x2\nEvading\nDisobaying a Peace officer\nArmed Robbery\n\n', '[]', '["927 MDJ"]', '["Daniel Jordan","jaquavius dingleberry"]', '[]', '1680890004332', 'police'),
	(12, 'Matthew Jacobs', 'House robbery', 'House robbery', 'group of 3 men stole a police car and robbed a house. men were armed and dangerous, 927 was assaulted and opened fire on the police vehicle due to there being a M4 rifle in the glovebox. 2 min later there was Shots fired outside of DPD where i found the car plus some casings. \n\nlocker 998.', '[]', '["927 matthew d jacobs"]', '[]', '[]', '1680894024861', 'police'),
	(13, 'John King', 'Attempted Murder on LEO', 'Arrest', '495 and 927 responded to a House Robbery in Vinnewood Hills, Upon arrival - 495 saw two S VC parked outside with windows to be looked as smashed in. - When on scene 495 also saw two males (#1 Wearing a black sweatshirt with gray pants) (#2 Wearing a red hoodie with black pants) - 495 went on a 10-80 witht the first VC up in Vinnewood where the suspect tried taking a jump over a house, he ended up in between the hill and house, this is where 495 decided to go down and taze the person - Unfortunattly as 495 was pulling out his tazer the suspect charged at him with a silenced pistol and started to shoot.\n\n495 took cover and armored up behind the house - 495 heard a other car pull out and leave, 495 quickly realized that the suspect had been picked up by his acomplice.\n\n495 and 927 did an evidence sweep and found casings from the gun.\n\nCasing # 66tly0Di602ioV\n\nPossible Charges:\n1x Burglary\n1x Reckless Evading\n1x Criminal Use of a Class 1 Fireamrs\n1x Attempted Murder on a Peace Officer\n1X Evading', '[]', '["927","495"]', '[]', '["https://i.imgur.com/mfhzn77.png","https://i.imgur.com/Sd4RI3m.png","https://i.imgur.com/G4c2394.png"]', '1680899540609', 'police'),
	(14, 'Matthew Jacobs', 'Revoked Firearm license', 'permit', 'Benjamin Larsen did not have a picture on his Weapon\'s permit so its invalid.', '[]', '[]', '[]', '[]', '1680976706513', 'police');

